class Main extends Component {

    constructor(props) {
        super(props)
        this.state = {
          gender: 'male',
          height: 0,
          weight: 0,
          age: 0,
          showIncompleteWarning: false
        }
        this.onDetailChange = this.onDetailChange.bind(this)
      }
    render(){
    return (
        <div className="block-cards">
                    <div className="item-card">
                        1
                    </div>
                    <div className="item-card">
                        2
                    </div>
                    <div className="item-card">
                        3
                    </div>
            </div>
    )
    }
}

export default Main
